import React, { useState, useEffect } from "react";
import './GetFastfood.css';

const GetFastfood = () => {

    const [fastfoods, setFastfoods] = useState([]);

    const getFastfoods = async() => {
        try {
            const response = await fetch("http://localhost:8000/fastfood");
            const jsonData = await response.json();

            setFastfoods(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    };

    useEffect(() => {
        getFastfoods();
    });

    return (
        <>
            <table className="table table-hover">
    <thead>
      <tr>
        <th>Park ID</th>
        <th>Name</th>
        <th>Type</th>
        <th>Price</th>
      </tr>
    </thead>
    <tbody>
        {/*<tr>
        <td>John</td>
        <td>Doe</td>
        <td>john@example.com</td>
      </tr>*/}
      {fastfoods.map(fastfood => (
                        <tr>
                            <td>{fastfood.park_id}</td>
                            <td>{fastfood.name}</td>
                            <td>{fastfood.type}</td>
                            <td>{fastfood.price}</td>
                        </tr>
                    ))}

    </tbody>
  </table>


        </>
    )
};

export default GetFastfood;
